import React from "react";
import { variable } from "../service/api";

const Navbar = () => {
    return (
      <nav>
        <ul className="menus">
          {variable.menuItems.map((menu, index) => {
            return (
              <li className="menu-items" key={index}>
                <a href={menu.url}>{menu.title}</a>
              </li>
            );
          })}
        </ul>
      </nav>
    );
  };
  
  export default Navbar;
